/** @jsx jsx */

import React, { Component } from 'react';
import { css, jsx } from '@emotion/core';

import Description from '../components/Description';
import Thumbnail from '../components/Thumbnail';
import Photo from '../assets/photos/DiegoFigueroa-MK.JPG'
import Article from '../components/Article'

const paperStyle = css`
    .paper {
        margin-bottom: 1em;
    }
`;

const content = {
  header: "Writing",
  description: "Here are some papers and articles I've written."
}

export default class PageAbout extends Component {
  render() {
    return (
      <Article {...content}>
        <div css={paperStyle}>
          <div class="paper">
            <a target="_blank" href={require('assets/files/MinimalJustice.pdf')}>Minimal Justice and Obligation to Obey the Law, 2019</a>
            <p>An examination of obligation to obey the law for those who get more than their fair share.</p>
          </div>
          <div class="paper">
            <a target="_blank" href={require('assets/files/MinimalJustice.pdf')}>Limitations of Mill’s Justification of Free Expression, 2019</a>
            <p>A case for why Mill’s free marketplace ideas do not function as he intended.</p>
          </div>
          <div class="paper">
            <a target="_blank" href={require('assets/files/MinimalJustice.pdf')}>A Moral Bargaining Account of Animals, 2019</a>
            <p>An extension of Harman’s social bargaining theory of morality.</p>
          </div>
          <div class="paper">
            <a target="_blank" href={require('assets/files/MinimalJustice.pdf')}>Addressing the Problem of Fundamental Authority, 2019</a>
            <p>A problem for Gibbard’s normative authority and a potential solution.</p>
          </div>
          <div class="paper">
            <a target="_blank" href={require('assets/files/MinimalJustice.pdf')}>Modifying the Deep Self Theory of Free Will, 2019</a>
            <p>A caveat for Wolf’s theory of free will.</p>
          </div>
        </div>
        <h3>Philosophy Papers</h3>
      </Article>
    );
  }
}
